{'message': '卓司因为一直活在妄想中，相信自己是不会死的，所以说出了这番话。而皆守由于杀死了弟弟以及由岐的死受到了巨大的精神打击，精神层面想逃避现实于是相信了卓司的话并以此活了下去。

感觉虽然用超能力解释比较简单（A:为什么会这样？会那样？  B:因为超能力  A:原来如此，明白了）
