{'message': '关于清明上河图的版本，问了一下度娘_(:3」∠)_：

现藏台北故宫博物院的《清明上河图》，画有五百五十余人，各种牲畜六十多匹，木船二十多只，房屋楼阁三十多栋，推车乘轿也有二十多件。

台北故宫博物院的《清明上河图》是清朝乾隆年间，由清宫画家陈枚、孙佑等人精心细绘了“最新作品”《清明上河图》，参与这幅画的画家人数有5人之多，创作时间最长，从雍正晚年至乾隆元年，画得也最为精细艳丽，被认为是画得最精美的一幅《清明上河图》。该画长1152厘米，宽35厘米，（乾隆元年12月15日奉）。它与北京故宫收藏的北宋张择端画的《清明上河图》，沈阳辽宁省博物馆收藏的明朝仇英画的《清明上河图》同为精品之作。', 'plat': 0, 'device': ''}

